import React, { useState, useEffect } from 'react';
import { transactionsAPI } from '../services/api';
import TransactionForm from './TransactionForm';
import TransactionList from './TransactionList';

function Dashboard({ user, onLogout }) {
  const [transactions, setTransactions] = useState([]);
  const [summary, setSummary] = useState({ total_income: 0, total_expenses: 0, balance: 0 });
  const [editingTransaction, setEditingTransaction] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    // Verify token exists
    const token = localStorage.getItem('token');
    console.log('Dashboard mounted, token exists:', !!token);

    if (token) {
      fetchTransactions();
      fetchSummary();
    } else {
      setError('No authentication token found');
      setLoading(false);
    }
  }, []);

  const fetchTransactions = async () => {
    try {
      setError('');
      const response = await transactionsAPI.getAll();
      console.log('Transactions fetched:', response.data);
      setTransactions(response.data);
    } catch (error) {
      console.error('Error fetching transactions:', error);
      console.error('Error response:', error.response?.data);
      setError('Failed to fetch transactions');
    } finally {
      setLoading(false);
    }
  };

  const fetchSummary = async () => {
    try {
      const response = await transactionsAPI.getSummary();
      console.log('Summary fetched:', response.data);
      setSummary(response.data);
    } catch (error) {
      console.error('Error fetching summary:', error);
      console.error('Error response:', error.response?.data);
    }
  };

  const handleAddTransaction = async (formData) => {
    try {
      setError('');
      console.log('Adding transaction:', formData);
      const response = await transactionsAPI.create(formData);
      console.log('Transaction added:', response.data);

      // Refresh data
      await fetchTransactions();
      await fetchSummary();
    } catch (error) {
      console.error('Error adding transaction:', error);
      console.error('Error response:', error.response?.data);
      setError('Failed to add transaction');
    }
  };

  const handleUpdateTransaction = async (formData) => {
    try {
      setError('');
      console.log('Updating transaction:', editingTransaction.id, formData);
      await transactionsAPI.update(editingTransaction.id, formData);
      setEditingTransaction(null);

      // Refresh data
      await fetchTransactions();
      await fetchSummary();
    } catch (error) {
      console.error('Error updating transaction:', error);
      console.error('Error response:', error.response?.data);
      setError('Failed to update transaction');
    }
  };

  const handleDeleteTransaction = async (id) => {
    if (window.confirm('Are you sure you want to delete this transaction?')) {
      try {
        setError('');
        console.log('Deleting transaction:', id);
        await transactionsAPI.delete(id);

        // Refresh data
        await fetchTransactions();
        await fetchSummary();
      } catch (error) {
        console.error('Error deleting transaction:', error);
        console.error('Error response:', error.response?.data);
        setError('Failed to delete transaction');
      }
    }
  };

  if (loading) {
    return (
      <div style={styles.container}>
        <p>Loading...</p>
      </div>
    );
  }

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h1>Personal Finance Tracker</h1>
        <div style={styles.userInfo}>
          <span>Welcome, {user.username}</span>
          <button onClick={onLogout} style={styles.logoutButton}>
            Logout
          </button>
        </div>
      </div>

      {error && (
        <div style={styles.errorBanner}>
          {error}
        </div>
      )}

      <div style={styles.summary}>
        <div style={styles.summaryCard}>
          <h3>Total Income</h3>
          <p style={{ color: '#28a745', fontSize: '1.5rem', fontWeight: 'bold' }}>
            ${summary.total_income.toFixed(2)}
          </p>
        </div>
        <div style={styles.summaryCard}>
          <h3>Total Expenses</h3>
          <p style={{ color: '#dc3545', fontSize: '1.5rem', fontWeight: 'bold' }}>
            ${summary.total_expenses.toFixed(2)}
          </p>
        </div>
        <div style={styles.summaryCard}>
          <h3>Balance</h3>
          <p style={{ 
            color: summary.balance >= 0 ? '#28a745' : '#dc3545',
            fontSize: '1.5rem',
            fontWeight: 'bold'
          }}>
            ${summary.balance.toFixed(2)}
          </p>
        </div>
      </div>

      <TransactionForm
        onSubmit={editingTransaction ? handleUpdateTransaction : handleAddTransaction}
        editingTransaction={editingTransaction}
        onCancel={() => setEditingTransaction(null)}
      />

      <TransactionList
        transactions={transactions}
        onEdit={setEditingTransaction}
        onDelete={handleDeleteTransaction}
      />
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '2rem',
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '2rem',
  },
  userInfo: {
    display: 'flex',
    alignItems: 'center',
    gap: '1rem',
  },
  logoutButton: {
    padding: '0.5rem 1rem',
    backgroundColor: '#dc3545',
    color: 'white',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
  },
  summary: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
    gap: '1rem',
    marginBottom: '2rem',
  },
  summaryCard: {
    backgroundColor: 'white',
    padding: '1.5rem',
    borderRadius: '8px',
    boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
    textAlign: 'center',
  },
  errorBanner: {
    backgroundColor: '#f8d7da',
    color: '#721c24',
    padding: '1rem',
    borderRadius: '4px',
    marginBottom: '1rem',
    border: '1px solid #f5c6cb',
  },
};

export default Dashboard;
